import React from "react";
import Box from "@material-ui/core/Box";
import Collapse from "@material-ui/core/Collapse";
import IconButton from "@material-ui/core/IconButton";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Typography from "@material-ui/core/Typography";
import Paper from "@material-ui/core/Paper";
import KeyboardArrowDownIcon from "@material-ui/icons/KeyboardArrowDown";
import KeyboardArrowUpIcon from "@material-ui/icons/KeyboardArrowUp";
import Checkbox from "@material-ui/core/Checkbox";

function createData(name, calories, fat, carbs, protein, price) {
  return {
    name,
    calories,
    fat,
    carbs,
    protein,
    price,
    history: [
      { date: "2020-01-05", customerId: "11091700", amount: 3 },
      { date: "2020-01-02", customerId: "Anonymous", amount: 1 },
    ],
  };
}

function Row(props) {
  const { row } = props;
  const [open, setOpen] = React.useState(false);
  console.log(row);
  return (
    <React.Fragment>
      <TableRow>
        <TableCell>
          <IconButton
            aria-label="expand row"
            size="small"
            onClick={() => setOpen(!open)}
          >
            {open ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
          </IconButton>
        </TableCell>
        <TableCell component="th" scope="row">
          {
            row.column_values.find((obj) => {
              return obj.title === "Name";
            }).text
          }
        </TableCell>
        <TableCell>
          {
            row.column_values.find((obj) => {
              return obj.title === "Email";
            }).text
          }
        </TableCell>
        <TableCell>
          {
            row.column_values.find((obj) => {
              return obj.title === "Role";
            }).text
          }
        </TableCell>
        <TableCell>
          {
            row.column_values.find((obj) => {
              return obj.title === "Team";
            }).text
          }
        </TableCell>
        <TableCell>
          {
            row.column_values.find((obj) => {
              return obj.title === "Most Productive Hours";
            }).text
          }
        </TableCell>
      </TableRow>
      <TableRow>
        <TableCell style={{ paddingBottom: 0, paddingTop: 0 }} colSpan={6}>
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box margin={1}>
              <Typography variant="h6" gutterBottom component="div">
                Productive Hours
              </Typography>
              <Table size="small" aria-label="purchases">
                <TableHead>
                  <TableRow>
                    <TableCell>9 AM - 10 AM</TableCell>
                    <TableCell>10 AM - 11 AM</TableCell>
                    <TableCell>11 AM - 12 PM</TableCell>
                    <TableCell>12 PM - 1 PM</TableCell>
                    <TableCell>1 PM - 2 PM</TableCell>
                    <TableCell>2 PM - 3 PM</TableCell>
                    <TableCell>3 PM - 4 PM</TableCell>
                    <TableCell>4 PM - 5 PM</TableCell>
                    <TableCell>5 PM - 6 PM</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {/* Skip 5 main columns */}
                  {/* {row.column_values.splice(5).map((hours) => ( */}
                  <TableRow>
                    <TableCell scope="row">
                      <Checkbox
                        disabled
                        checked={
                          row.column_values.find((obj) => {
                            return obj.title === "9-10";
                          }).text === "v"
                        }
                      />
                    </TableCell>
                    <TableCell>
                      <Checkbox
                        disabled
                        checked={
                          row.column_values.find((obj) => {
                            return obj.title === "10-11";
                          }).text === "v"
                        }
                      />
                    </TableCell>
                    <TableCell align="right">
                      <Checkbox
                        disabled
                        checked={
                          row.column_values.find((obj) => {
                            return obj.title === "11-12";
                          }).text === "v"
                        }
                      />
                    </TableCell>
                    <TableCell align="right">
                      <Checkbox
                        disabled
                        checked={
                          row.column_values.find((obj) => {
                            return obj.title === "12-1";
                          }).text === "v"
                        }
                      />
                    </TableCell>
                  </TableRow>
                  {/* ))} */}
                </TableBody>
              </Table>
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </React.Fragment>
  );
}

const rows = [
  createData("Frozen yoghurt", 159, 6.0, 24, 4.0, 3.99),
  createData("Ice cream sandwich", 237, 9.0, 37, 4.3, 4.99),
  createData("Eclair", 262, 16.0, 24, 6.0, 3.79),
  createData("Cupcake", 305, 3.7, 67, 4.3, 2.5),
  createData("Gingerbread", 356, 16.0, 49, 3.9, 1.5),
];

export default function Board(props) {
  console.log(props);
  return (
    <Box p={2}>
      <Box my={3}>{props.data.name}</Box>
      <TableContainer component={Paper}>
        <Table aria-label="collapsible table">
          <TableHead>
            <TableRow>
              <TableCell />
              <TableCell>Name</TableCell>
              <TableCell>Email</TableCell>
              <TableCell>Role</TableCell>
              <TableCell>Team</TableCell>
              <TableCell>Most Productive Hours</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {props.data.items.map((row) => (
              <Row key={row.name} row={row} />
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}
